import React, { useState ,useEffect} from 'react';
import { Text,StyleSheet, View, TouchableOpacity,Image,Picker ,Dimensions} from 'react-native';
import ProgressBar1 from './ProgressBar1'
console.disableYellowBox = true;


 
export default class Serch extends React.Component { 
  constructor(props) {
    super(props);
   
  }
 
  state={
    backgroundColor: 'black',
    backgroundColor2: 'black',
    pressed: false,
  };
  changeColor= () => {
    if(!this.state.pressed){
       this.setState({ pressed: true,backgroundColor: 'red', backgroundColor2: 'black'});
    } else {
      this.setState({ pressed: false, backgroundColor: 'black' ,backgroundColor2: 'red'});
    }
  }
  render() {
        return (
          <TouchableOpacity  style={styles.itemView2} onPress={this.props.onPress} > 
                    <TouchableOpacity  onPress={this.props.onPress}
                             style={styles.TouchableOpacity}

        >
                    <View style={styles.container}>
                    <Image source={this.props.imageSource1}  style={styles.Image}/>
                    </View>
             </TouchableOpacity>
             <TouchableOpacity  onPress={this.props.onPress}>
                    <Text style={styles.itemText}>{this.props.title}</Text> 
                    <Text style={styles.itemText1}>{this.props.data}</Text> 
                    <ProgressBar1 colorb={this.props.colore} step={this.props.data1} steps={this.props.data2}/>
              </TouchableOpacity>
          </TouchableOpacity>
      );  
    }
} 
  // creat
    // create style to component
    const styles = StyleSheet.create({
      TouchableOpacity:{
        marginLeft:45,
        marginTop:20,
        borderRadius: 37.55 ,
        width:73.461, 
        height:73.461,
        padding:20,
        backgroundColor: 'white',
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        
        elevation: 24,
      },
      container: {
        justifyContent: 'center',
        alignItems: 'center',
      },
      Image:{
        justifyContent: 'center',
      },
      
      itemView2: {
        backgroundColor: 'white',
        height:178.476 ,
        width:"45%",
        margin:10,
        marginRight:5,
        marginLeft:10,
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        borderRadius: 4.68,
        
        elevation: 24,
      },
      itemFont: {
       borderRadius: 500,
       width:90,
       padding:20,
       shadowColor: "#000",
       shadowOffset: {
         width: 0,
         height: 16,
       },
       shadowOpacity: 0.58,
       shadowRadius: 16.00,
       
       elevation: 24,
       
      },
      itemFont2: {
        color:'blue',
        fontSize:24,
        marginTop:20,
        marginLeft:40,
        backgroundColor: 'white',
        borderRadius: 500,
        width:70,
        padding:20,
        shadowColor: "#000",
        shadowOffset: {
        width: 0,
        height: 16,
        },
        shadowOpacity: 1,
        shadowRadius: 16.00,
        elevation: 24,
        
       },
      itemText:{
        textAlign: 'center',
        marginTop:5,
        fontSize:17.02,
        fontWeight:"bold"

      },
      itemText1:{
        textAlign: 'center',
        marginTop:5,
        fontSize:13.64,
        fontWeight:"bold"

      },
      Image2:{
        width:160,
        marginLeft:5,
        marginTop:5
      }
      });
